import React from "react";
import "./App.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function App() {
  // const scrollToDiv = (ref) => window.scrollTo(0, ref.current.offsetTop);
  // const el1 = useRef();
  // const el2 = useRef();
  return (
    <div className="bgImage">
      <div className="bgBlack overflow-scroll">
        <div
          id="landingPage"
          className="container d-flex flex-row justify-content-center justify-content-md-start align-items-center w-100 h-100"
        >
          <div className="row border w-100">
            <div className="col-12 col-md-6 border">
              <h1 className="mainTitle text-white text-md-left text-center border my-auto">Test Name <FontAwesomeIcon icon="facebook" /></h1>
              <div className="d-flex flex-row">
                <FontAwesomeIcon icon={['fab','facebook']} />
                <i className="fab fa-facebook"></i>
                <i className="fab fa-instagram"></i>
                <i className="fab fa-youtube"></i>
                <i className="fas fa-envelope"></i>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
